Covid – 19 Pandemisi sebebiyle üniversitemize kayıt yaptırmaya hak kazanıp gelemeyen öğrencilerin işlemlerini kolaylaştırmak adına online geçici kayıt imkanı sağlanmış bulunmaktadır. Öğrencilerin 04 Eylül - 18 Eylül 2020 tarihleri arasında aşağıdaki listede yer alan belgeleri tarayarak registeronline@gop.edu.tr adresine mail atmaları gerekmektedir. Kayıt işlemleri tamamlanan öğrencilerin mail adreslerine “Geçici Öğrenci Belgesi” gönderilecektir.

Geçici kayıt işlemleri tamamlanan öğrencilerin belgelerinin asıllarını 31.12.2020 tarihine kadar Tokat Gaziosmanpaşa Üniversitesi Öğrenci İşleri Daire Başkanlığı’na teslim etmeleri zorunludur.

Önemli Not: Mailin konu kısmına “Aday Numaranızı, Adınızı ve Soyadınızı” yazınız.
Online Geçici Kayıt İçin Gerekli Belgeler:

1.Lise Diplomasının aslı ve Not döküm cetvelinin (Transkript) aslı
2.Varsa, Türkçe dil yeterlilik belgesi
3.Pasaport fotokopisi (Lütfen mail içeriğine anne adı ve baba adı ekleyiniz)
4.Kabul Mektubu
5.T.C. uyruklu adayların Kimlik Kartı fotokopisi
6.Çift uyruklu adaylar için vukuatlı nüfus kayıt örneği
7.Mavi kart sahibi adaylar için mavi kart belgesi
🗣 B1, B2, C1veya C2 seviyede TÖMER veya TYS (Yunus Emre Enstitüsü Türkçe Yeterlik Sınavı) belgesine sahip olan öğrenciler TÖMER Türkçe hazırlık eğitiminden muaf tutulurlar.
 

🗣 Lise eğitimlerini T.C. Milli Eğitim Bakanlığına bağlı Türk liselerinde tamamlayan adayların Türkçesi yeterli olarak kabul edilir.
Online Geçici Kayıt tarihleri: 04 Eylül - 18 Eylül 2020
